import React from "react";
import ReactDOM from "react-dom/client";
import { HashRouter } from "react-router-dom"
import "./index.css";
import App from "./components/App";

ReactDOM.createRoot(
  document.getElementById("root"),
)
.render(
  <HashRouter>
    <React.StrictMode>
          <App />
    </React.StrictMode>
  </HashRouter>
);
